import React from "react";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

const ProductCard = () => {
    return (
        <Col md={4}>
            <div className="card p-3 my-2 bg-light rounded">
                <Card.Img
                    variant="top"
                    src="https://res.cloudinary.com/dsip2gx3i/image/upload/v1623699422/CPR%20-%20Calibras/mannequin-3.jpg"
                />
                <Card.Body>
                    <h3 className="fw-bold fs-2">First Aid CPR/AED</h3>
                    <ul>
                        <li className="py-1 fw-bold">Teachers</li>
                        <li className="py-1 fw-bold">
                            Fitness/Health Trainers
                        </li>
                        <li className="py-1 fw-bold">All Hotel Staff</li>
                        <li className="py-1 fw-bold">Sport Coaches & Staff</li>
                    </ul>
                    <a href="book.html" className="btn btn-danger mt-3">
                        Schedule Now
                    </a>
                </Card.Body>
            </div>
        </Col>
    );
};

export default ProductCard;
